import styles from "./ImagePlot.module.css";
import { useEffect, useState } from "react";

const ImagePlot = () => {
  const [data, setData] = useState(null)
  useEffect(() => {
    fetch('https://raw.githubusercontent.com/NavSous/Software-Studio-Project/data/co2.csv')
      .then(response => response.text())
      .then(data => {
        let datapoints = data.split("\n").slice(1, -1).map(x => {
          return x.split(",").map(y => {
            return parseFloat(y);
          });
        })
        setData(datapoints)
      })
      .catch(err => console.error(err));
  },[])

  return   data && <img className={styles.image1Icon} alt="" src="https://github.com/NavSous/Software-Studio-Project/blob/data/images/co2_30.png?raw=true" />;

